column73:
The Contractor will provide legal services for the British Embassy Warsaw within the following scope:
- Legal services in all areas related to human resource management, including but not limited to, labour and social security law, litigation, compliance, taxes including PIT, personal data protection;
- Pro bono legal services;
Legal advice on global mobility and immigration as well as relationship with trade unions, negotiations and collective disputes.

Creation of a National Framework for the Maintenance of Firearms Ranges, the scope of which will include: 
•	de-leading, sanitation and deep cleaning; 
•	annual deep cleans;
•	repair or replacement of materials;
•	miscellaneous works including but not limited to upgrades, refurbishments and/or improvements to ranges; and
•	the supply of and delivery of consumables for the Firearms Ranges.
